import React from 'react';
import './App.css';
//import './bootstrap.css'
import BirthdayCalendarApp from './Components/BirthdayCalendarApp';
import Button from 'react-bootstrap/Button';

function App() {
  return (
    <div className="App">
      <BirthdayCalendarApp/>
      <Button variant="primary">Test</Button>
    </div>    
  );
}

export default App;
